
<!DOCTYPE html>
<html lang="ru">
<head>
    <meta charset="UTF-8">
    <title>До встречи с любимым</title>
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <style>
        html, body {
            margin: 0;
            background-color: black;
            color: white;
            font-family: 'Arial', sans-serif;
            text-align: center;
        }

        h1 {
            font-size: 5vw;
            margin: 4vw 0 2vw;
        }

        .hearts {
            color: red;
            font-size: 5vw;
            margin: 0 1vw;
        }

        #timer {
            font-size: 4.5vw;
            margin: 2vw auto;
            padding: 2vw 4vw;
            border: 2px solid red;
            border-radius: 10px;
            background-color: rgba(255, 255, 255, 0.1);
            display: inline-block;
        }

        #no-js {
            font-size: 4.5vw;
            color: orange;
            margin-top: 3vw;
        }

        #photo {
            width: 100%;
            max-height: 60vh;
            object-fit: cover;
            cursor: pointer;
            margin-top: 3vw;
        }

        #click-tip {
            font-size: 4vw;
            color: #ccc;
            margin-top: 2vw;
        }

        .music-btn {
            margin: 4vw auto;
            font-size: 4vw;
            padding: 1.5vw 3vw;
            background: #d70000;
            color: white;
            border: none;
            border-radius: 10px;
            cursor: pointer;
        }

        .flight-line {
            position: relative;
            width: 100%;
            margin-top: 6vw;
            height: 30px;
            overflow: hidden;
        }

        .flight-labels {
            position: absolute;
            top: -18px;
            width: 100%;
            display: flex;
            justify-content: space-between;
            padding: 0 5vw;
            font-size: 4vw;
        }

        .dotted-line {
            border-top: 2px dotted white;
            position: absolute;
            top: 10px;
            left: 5vw;
            right: 5vw;
            height: 0;
        }

        .plane {
            position: absolute;
            top: -10px;
            left: 5vw;
            font-size: 5vw;
            animation: flyPlane 10s linear infinite;
        }

        @keyframes flyPlane {
            0% { left: 5vw; }
            100% { left: 90vw; }
        }
    </style>
</head>
<body>

    <div class="flight-line">
        <div class="flight-labels">
            <span>🇪🇬 Египет</span>
            <span>Актобе 🇰🇿</span>
        </div>
        <div class="dotted-line"></div>
        <div class="plane">✈️</div>
    </div>

    <script>
        // Таймер
        const countdown = () => {
            const timer = document.getElementById("timer");
            const now = new Date();
            const target = new Date("2025-08-12T01:00:00Z"); // 04:00 Актобе = 01:00 UTC
            const diff = target - now;

            if (diff <= 0) {
                timer.innerHTML = "Совсем скоро!";
                return;
            }

            const days = Math.floor(diff / (1000 * 60 * 60 * 24));
            const hours = Math.floor((diff / (1000 * 60 * 60)) % 24);
            const minutes = Math.floor((diff / (1000 * 60)) % 60);
            const seconds = Math.floor((diff / 1000) % 60);

            timer.innerHTML =
                days + " д. " + hours + " ч. " + minutes + " мин. " + seconds + " сек.";
        };

        if (typeof window !== "undefined") {
            document.getElementById("no-js").style.display = "none";
            setInterval(countdown, 1000);
            countdown();
        }

        // Музыка
        const audio = document.getElementById("music");
        const photo = document.getElementById("photo");

        function playMusic() {
            audio.play();
        }

        photo.addEventListener("click", () => {
            playMusic();
        });

        photo.addEventListener("touchstart", () => {
            playMusic();
        });
    </script>
